<template>
  <div>
    <img-list :data-array="dataArray" />
    <van-popup
      closeable
      v-if="faceDetectionFlag"
      close-icon="arrow-left"
      v-model="faceDetectionFlag"
      close-icon-position="top-left"
      position="right"
      :style="{ height: '100%', width: '100%' }"
    >
      <face-input-component />
    </van-popup>
  </div>
</template>
<script>
import ImgList from './components/ImgList.vue'
import FaceInputComponent from './components/faceInputComponent.vue'
export default {
  name: 'FaceStore',
  components: {
    ImgList,
    FaceInputComponent
  },
  watch: {
    faceDetectionFlag: {
      handler(val) {
        if (!val) {
          let userList = localStorage.getItem('currentImg')
          this.dataArray = JSON.parse(userList) || []
        }
      }
    }
  },
  data() {
    return {
      showDrawer: false,
      faceDetectionFlag: false,
      dataArray: [
        {
          id: '123123',
          src: 'data:image/png;base64,'
        },
        {
          src: 'https://img01.yzcdn.cn/vant/cat.jpeg',
          id: '1',
          desc: ''
        }
      ]
    }
  },
  created() {
    let userList = localStorage.getItem('currentImg')
    this.dataArray = JSON.parse(userList) || []
  },
  mounted() {
    this.$bus.$on('addUserFace', () => {
      this.faceDetection()
    })
  },

  methods: {
    faceDetection() {
      this.faceDetectionFlag = true
    }
  }
}
</script>

<style scoped lang="scss"></style>
